import styles from './Footer.module.css';

function Footer() {
    return(
        <div className={styles.footer}>
            <footer>
                <p><a href="mailto:thiagobittencourt112@rede.ulbra.br"></a></p>
            </footer>
        </div>
    );
}

export default Footer;
